import "./Project.css";

const Project = (props) => {
    return (
        <div className="card-item">
            <li>
                <h3>{props.title}</h3>
                <div className='card-wrapper'>
                    <div className="card-img-wrapper">
                        <img src={props.src} alt={props.alt}
                        className='card_img'/>
                    </div>
                    <div className="card-text-wrapper">
                        <p>{props.description}</p>
                    </div>
                    <div className="skills"><p className='skills'>{props.skills}</p></div>
                </div>
                <div className="neon-button">
                    <p><a rel="noreferrer" href={props.path} target="_blank">Check it out!</a></p>
                </div>
            </li>
        </div>
    );
}

export default Project;
